import React from "react";
import Background from "../img/background.jpg";
import NavBar from "./navbar";
import { Button } from '@entur/component-library';

class Home extends React.Component {

    handleClick = (event) => {
        if(event.target.value === 'register'){
            this.props.history.push('/register');
        }
        if(event.target.value === 'overview'){
            this.props.history.push('/overview')
        }
    };

    render() {
        return (
            <div>
                <img id="background" src={ Background } alt="" />
                <NavBar user={this.props.user} logout={this.props.logout} />
                <div className="register_box" id="small">
                    <div className='home-content'>
                        <br></br>
                        <h2 className="text-center text-white">Go-Ahead</h2>
                        <br></br>
                        <div className="justify-content-center">
                            <Button variant="secondary" onClick={this.handleClick} type="button" value="register" className="btn btn-primary btn-lg btn-block">Ny melding</Button>
                            <Button variant="secondary" onClick={this.handleClick} type="button" value="overview" className="btn btn-primary btn-lg btn-block">Aktive meldinger</Button>
                        </div>
                        <br></br>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
